import React from "react";

const zipVal = "";

const Search = () => {
  return (
    <div>
      <nav className="navbar navbar-light">
        <form className="form-inline">
          <input
            type="text"
            placeholder="Enter a zip code"
            aria-label="Search"
            id="zipInput"
            value={zipVal}
          />
          <button
            className="btn btn-outline-success my-2 my-sm-0"
            id="submit"
            type="submit"
          >
            Search
          </button>
        </form>
      </nav>
    </div>
  );
};

export default Search;
